#!/bin/sh
# Name: SoxUI
# Author: GC777
# Icon: data:image/png;base64,
# DontUseFBInk

SOURCE_DIR="/mnt/us/documents/SoxUI"
TARGET_DIR="/var/local/mesquite/SoxUI"
DB="/var/local/appreg.db"
APP_ID="com.illusion.soxui"

# Utild (KindleForge-style): run Utild if binaries exist
BINARY="$SOURCE_DIR/binaries/UtildSF"
OTHER="$SOURCE_DIR/binaries/UtildHF"
if [ -e /lib/ld-linux-armhf.so.3 ]; then
  BINARY="$SOURCE_DIR/binaries/UtildHF"
  OTHER="$SOURCE_DIR/binaries/UtildSF"
fi

if [ -e "$BINARY" ]; then
  cp "$BINARY" /var/local/kmc/
fi

if [ -e /var/local/kmc/UtildHF ]; then
  chmod +x /var/local/kmc/UtildHF
  /var/local/kmc/UtildHF
else
  if [ -e /var/local/kmc/UtildSF ]; then
    chmod +x /var/local/kmc/UtildSF
    /var/local/kmc/UtildSF
  fi
fi

if [ -e "$OTHER" ]; then
  rm -f "$OTHER"
fi

# Preserve TARGET binaries if SOURCE has none (upgrade scenario)
if [ ! -d "$SOURCE_DIR/binaries" ] && [ -d "$TARGET_DIR/binaries" ]; then
  mv "$TARGET_DIR/binaries" /tmp/binaries_backup
fi

# Copy to var/local/mesquite
if [ -d "$SOURCE_DIR" ]; then
  if [ -d "$TARGET_DIR" ]; then
    rm -rf "$TARGET_DIR"
  fi
  cp -r "$SOURCE_DIR" "$TARGET_DIR"
else
  exit 1
fi

if [ -d /tmp/binaries_backup ]; then
  mv /tmp/binaries_backup "$TARGET_DIR/binaries"
fi

if [ -d "$SOURCE_DIR/binaries" ]; then
  rm -rf "$SOURCE_DIR/binaries"
fi

# Redeclare to appreg.db
sqlite3 "$DB" <<EOF
INSERT OR IGNORE INTO interfaces(interface) VALUES('application');
INSERT OR IGNORE INTO handlerIds(handlerId) VALUES('$APP_ID');
INSERT OR REPLACE INTO properties(handlerId,name,value) VALUES('$APP_ID','lipcId','$APP_ID');
INSERT OR REPLACE INTO properties(handlerId,name,value) VALUES('$APP_ID','command','/usr/bin/mesquite -l $APP_ID -c file://$TARGET_DIR/');
INSERT OR REPLACE INTO properties(handlerId,name,value) VALUES('$APP_ID','supportedOrientation','U');
EOF

echo Registered $APP_ID, you may now launch it with LIPC.
sleep 2

nohup lipc-set-prop com.lab126.appmgrd start app://$APP_ID >/dev/null 2>&1 &
